lekcjaTutoriala = -1

const tutorialWinning = {
	lekcja1: {method:'positions-taken'},
	lekcja2: {method:'positions-taken'},
	lekcja3: {method:'positions-taken'},
	lekcja4: {method:'all-cities-taken'},
	lekcja5: {method:'positions-taken-and-enemy-removed'},
	lekcja6: {method:'all-cities-taken'},
	lekcja7: {method:'enemy-removed'},
	lekcja8: {method:'positions-taken'},
	lekcja9: {method:'positions-taken-and-enemy-removed'},
}
function nazwyLekcji(lekcja){
	switch(lekcja){
		case 'lekcja1':return languagewise({pl:'Poruszanie oddziałów',en:'Moving units'})
		case 'lekcja2':return languagewise({pl:'Dzielenie i łączenie oddziałów',en:'Dividing and merging units'})
		case 'lekcja3':return languagewise({pl:'Oddziały wodne i desant',en:'Marine units and landing operations'})
		case 'lekcja4':return languagewise({pl:'Miasta i budowa oddziałów',en:'Towns and building units'})
		case 'lekcja5':return languagewise({pl:'Atakowanie oddziałów nieprzyjaciela',en:'Attacking units of the opponent'})
		case 'lekcja6':return languagewise({pl:'Desant',en:'Landing operation'})
		case 'lekcja7':return languagewise({pl:'Podatki i przemysł',en:'Taxes and industry'})
		case 'lekcja8':return languagewise({pl:'Oddziały saperskie',en:'Engineering units'})
		case 'lekcja9':return languagewise({pl:'Oddziały lotnicze',en:'Airforce'})
	}
}

function setTutorial(value){
	var selectedValue = value ? value : document.getElementById('select-tutorial').value
	switch(selectedValue){
		case 'lekcja1':
			readCodeFromString(kod1)
			break
		case 'lekcja2':
			readCodeFromString(kod2)
			break
		case 'lekcja3':
			readCodeFromString(kod3)
			break
		case 'lekcja4':
			readCodeFromString(kod4)
			break
		case 'lekcja5':
			readCodeFromString(kod5)
			break
		case 'lekcja6':
			readCodeFromString(kod6)
			break
		case 'lekcja7':
			readCodeFromString(kod7)
			break
		case 'lekcja8':
			readCodeFromString(kod8)
			break
		case 'lekcja9':
			readCodeFromString(kod9)
			break
		default:
			alert(languagewise({pl:'Wybierz zadanie tutoriala!',en:'Choose a tutorial lesson!'}))
	}
	if(selectedValue.slice(0,6) == 'lekcja'){
		podswd = -1
		podswu = -1
	}
	redraw(true)
}
function prepareTutorial(value){
	setTutorial(value)
	var selectedValue = value ? value : document.getElementById('select-tutorial').value
	if(selectedValue){
		lekcjaTutoriala = selectedValue
		changeState(4)
	}
	
}
function tutorialRestartLesson(){
	endGame(-3)
	prepareTutorial(lekcjaTutoriala)
}
function tutorialPreviousLesson(){
	var currentLesson = lekcjaTutoriala.slice(6)
	if(currentLesson > 1){
		endGame(-3)
		prepareTutorial('lekcja'+(currentLesson-1))
	}
}
function tutorialNextLesson(){
	var currentLesson = lekcjaTutoriala.slice(6)
	if(currentLesson < Object.values(tutorialWinning).length){
		endGame(-3)
		prepareTutorial('lekcja'+(currentLesson-(-1)))
	}
}
